import React from "react";
import { Link } from "react-router-dom";
import Book from "../images/book.jpg";
import Journal from "../images/journal.jpg";
import Project from "../images/project.jpg"


export const ResearchData = [

  {
    image: Book,
    heading: "Published Articles",
    paragraph: "You have free access to some of the articles published by LisaConsult",
    articles : {
        article1: <Link to="/research">Relationship between Organizational Climate, Employee Psychological Empowerment, and Innovation</Link>,
        article2: <Link to="/research">Top Management Team Demographic Diversities, Generic Strategy and Firm Performance</Link>,
        article3: <Link to="/research">The Moderating Effect Of Decision-Maker On The Relationship Between Strategy And Organizational Structure</Link>
    }
  },

  {
    image: <img src={Journal} alt="Journals" />,
    heading: "Books",
    paragraph: "Some of the books, which are ready to be published are:",
    articles : {
        article1: <Link to="/research">Success is a Matter of Personal Choice</Link>,
        article2: <Link to="/research">Security Investment</Link>,
        article3: <Link to="/research">Stress Management Strategies</Link>
    }
  },

  {
    image: <img src={Project} alt="Projects" />,
    heading: "Research Projects",
    paragraph: "Research is the basis for solutions, success, satisfaction, happiness and health.",
    articles : {
        article1: <Link to="/research">Eritrean refugees stress-coping Strategies and Psychological well-being</Link>,
        article2: <Link to="/research">National Reconciliation</Link>,
        article3: <Link to="/research">Strategic Leadership</Link>
    }
  },

];
